import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import L from 'leaflet';

// Your known kabadiwala/scrap center data
const kabadiwalas = [
  { name: "GreenTech E-Waste Center", lat: 18.5526, lng: 73.8251, address: "Baner, Pune" },
  { name: "EcoScrap Services", lat: 18.508, lng: 73.8567, address: "Shivajinagar, Pune" },
  { name: "ScrapHero", lat: 18.5047, lng: 73.8124, address: "Kothrud, Pune" },
  { name: "E-Waste Disposal Hub", lat: 18.5342, lng: 73.8808, address: "Yerwada, Pune" },
];

// Haversine formula to calculate distance
const haversineDistance = (lat1, lon1, lat2, lon2) => {
  const toRad = (x) => (x * Math.PI) / 180;
  const R = 6371; // Radius of Earth in km
  const dLat = toRad(lat2 - lat1);
  const dLon = toRad(lon2 - lon1);
  const a =
    Math.sin(dLat / 2) ** 2 +
    Math.cos(toRad(lat1)) *
      Math.cos(toRad(lat2)) *
      Math.sin(dLon / 2) ** 2;
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
};

const MapsLeaflet = () => {
  const [position, setPosition] = useState(null);
  const [nearby, setNearby] = useState([]);

  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      (pos) => {
        const coords = {
          lat: pos.coords.latitude,
          lng: pos.coords.longitude,
        };
        setPosition(coords);

        const nearbyFiltered = kabadiwalas.filter((place) => {
          const dist = haversineDistance(
            coords.lat,
            coords.lng,
            place.lat,
            place.lng
          );
          return dist <= 10; // 10 km radius
        });
        setNearby(nearbyFiltered);
      },
      (err) => {
        console.error("Geolocation error", err);
      }
    );
  }, []);

  const userIcon = new L.Icon({
    iconUrl: "https://maps.google.com/mapfiles/ms/icons/blue-dot.png",
    iconSize: [32, 32],
    iconAnchor: [16, 32],
  });

  return position ? (
    <div style={{ display: "flex", height: "100vh" }}>
      {/* Sidebar */}
      <div
        style={{
          width: "30%",
          padding: "1rem",
          overflowY: "auto",
          backgroundColor: "#f4f4f4",
          borderRight: "1px solid #ddd",
        }}
      >
        <h2>Nearby Kabadiwalas (within 10 km)</h2>
        {nearby.length === 0 ? (
          <p>No nearby centers found.</p>
        ) : (
          nearby.map((place, idx) => (
            <div
              key={idx}
              style={{
                marginBottom: "10px",
                padding: "10px",
                backgroundColor: "#fff",
                borderRadius: "5px",
                boxShadow: "0 0 3px rgba(0,0,0,0.1)",
              }}
            >
              <h4>{place.name}</h4>
              <p>{place.address}</p>
            </div>
          ))
        )}
      </div>

      {/* Map */}
      <div style={{ width: "70%" }}>
        <MapContainer center={position} zoom={13} style={{ height: "100vh", width: "100%" }}>
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; OpenStreetMap contributors"
          />

          <Marker position={position} icon={userIcon}>
            <Popup>You are here</Popup>
          </Marker>

          {nearby.map((place, index) => (
            <Marker key={index} position={{ lat: place.lat, lng: place.lng }}>
              <Popup>
                <strong>{place.name}</strong><br />
                {place.address}
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </div>
    </div>
  ) : (
    <p>Fetching location...</p>
  );
};

export default MapsLeaflet;
